import React, {useState} from "react";
import "./TopNav.css";

export default function TopNav() {
	const [menu, setMenu] = useState(false);
	const showMenu = () => setMenu(!menu);

	return (
		<div>
			<div className="navbar">
				<img className="menu-bars" src="./images/menu.svg" alt="menu" />
			</div>
		</div>
	);
}
